import { useEffect, useState } from "react";
import { useDispatch, useSelector } from "react-redux";
import {
  getSingleComunity,
  getComunityPosts,
  deleteComunityPost,
  addComunityPosts,
  updateComunityPosts,
  getComcomments,
  addComunityComment,
} from "../redux/ComunityPost";
import { useParams } from "react-router-dom";
import { Icon } from "@iconify/react";

const SingleComunity = () => {
  const dispatch = useDispatch();

    const { id } = useParams();
  // console.log(id)
  useEffect(() => {
    dispatch(getSingleComunity(id));
  }, [dispatch]);
  const singlepost = useSelector((state) => state.comunitypost);



  return (
    <>
      <div class="page-banner-area item-bg3">
        <div class="d-table">
          <div class="d-table-cell">
            <div class="container">
              <div class="page-banner-content">
                <h2>Community</h2>
                <ul>
                  <li>
                    <a href="index.html">Home</a>
                  </li>
                  <li>Blog Details</li>
                </ul>
              </div>
            </div>
          </div>
        </div>
      </div>
      {/* <!-- End Page Banner -->

        <!-- Start Blog Details Area --> */}

      <section class="blog-details-area ptb-100">
        <section class="class-area bg-fdf6ed pt-100 pb-70">
          <div class="container">
            <div class="section-title">
              <span>Classes</span>
              <h2>Post</h2>
            </div>




          </div>
          <div class="class-shape">

          </div>
        </section>
      </section>
    </>
  );
};
export default SingleComunity;
